function MaxConsecutiveOnes(arr) {
    let max = 0;
    let dict = {};
    if (arr.length == 0) return 0;
    console.log(arr.length)
    for (let i = 0; i < arr.length; i++) {
        if (!dict[arr[i]] && arr[i] == 1) {

            dict[arr[i]] = 1
        } else if (dict[arr[i]] && arr[i] == 1) {
            dict[arr[i]] += 1
        }

        if (arr[i] != 1) {
            if (dict['1'] > max) {
                max = dict['1']
                dict['1'] = 0
            }
        }
    };

    if (Object.keys(dict).length == 0) return 0;
    return max > dict['1'] ? max : dict['1']
}
